    const [categories, setCategories] = useState();
    useEffect(() => {
        GetAll().then(res => setCategories(res));
    }, []);

    const categoryItems = categories.map((category) => {
        <Member name={category.name}  />
    })

    return (
        <section className="team section-bg">
            <div className="container">

                <Title />

